import React from 'react';
import '../css/'


const Booking = ({ name, email, booked }) => {




    return (

        <>
            <div id='bookingcard'>
                <p>Customer Name : {name}</p>
                <p>Customer Email: {email}</p>
                {(booked.checked_in) ? 'checked in' : 'not checked in'}
            </div>
        </>
    )


};

export default Booking;
